svg.script:
//
/////////////////
// Stroke-inside
/////////////////
    // Create clip-path 
    window.addEventListener("load", e => {
        let xs = document.querySelectorAll("path.clipped");
        for (x of xs) {
            //console.log(x);
            let d = relativize(x.getAttribute("d"));
            d = d.replace(/^\s*m\s*-?\d*\.?\d+\s+-?\d*\.?\d+/i, "M0 0");

            x.style.clipPath = `path("${d}")`;
            //console.log(`path("${d}")`);
        }
    });

    function relativize(s) {
        let parts = Array.from(s.matchAll(/[a-z][^a-z]+/gi)).map(a => a[0]);
        let result = [];
        let pos = Vector.zero;
        for (let p of parts) {
            let args = Array.from(p.matchAll(/-?\d*\.?\d+/g)).map(parseFloat);
            let x = /^v/i.test(p) ? pos.x : /^h/i.test(p) ? args[args.length-1] : args[args.length-2];
            let y = /^h/i.test(p) ? pos.y : args[args.length-1];
            if (p[0].toLowerCase() == p[0]) {
                pos = new Vector(pos.x + x, pos.y + y)
                result.push(p);
                continue;
            }
            let dx = x - pos.x;
            let dy = y - pos.y;
            pos = new Vector(x, y);
            if (/^h/i.test(p)) {
                args[args.length-1] = dx;
            } else if (/^v/i.test(p)) {
                args[args.length-1] = dy;
            } else {
                args[args.length-2] = dx;
                args[args.length-1] = dy;
            }
            result.push(`${p[0].toLowerCase()} ${args.join(' ')}`);
        }
        return result.join(" ");
    }
//

//
/////////////////
// Vector library
/////////////////
    class Vector {
        static zero = new Vector(0, 0);

        constructor(x, y) {
            this.x = x;
            this.y = y;
        }

        get length() {
            return Math.sqrt(this.x*this.x + this.y*this.y);
        }

        get normalized() {
            return new Vector(this.x / this.length, this.y / this.length);
        }

        dot(other) {
            return this.x * other.x + this.y * other.y;
        }

        angleTo(other) {
            let result = Math.atan2(this.y, this.x) - Math.atan2(other.y, other.x);
            if (result > Math.PI) {
                result -= 2 * Math.PI;
            }
            return result;
        }

        toString() {
            return `(${this.x}, ${this.y})`;
        }

        equals(other) {
            return this.x == other.x && this.y == other.y;
        }

        add(other) {
            return new Vector(this.x + other.x, this.y + other.y);
        }

        sub(other) {
            return new Vector(this.x - other.x, this.y - other.y);
        }

        mul(factor) {
            return new Vector(this.x * factor, this.y * factor);
        }
    }

    class Matrix {
        constructor(components) {
            this.components = components;
        }

        static fromTranslate(def) {
            let parts = def.match(/^translate\(\s*(?<x>\S+)\s*(\s|,)\s*(?<y>\S+)\s*\)$/);

            return new Matrix([1, 0, parseFloat(parts.groups.x), 0, 1, parseFloat(parts.groups.y), 0, 0, 1]);
        }

        static fromTranslateX(def) {
            let parts = def.match(/^translateX\((?<x>\S+)\)$/);
            return new Matrix([1, 0, parseFloat(parts.groups.x), 0, 1, 0, 0, 0, 1]);
        }

        static fromTranslateY(def) {
            let parts = def.match(/^translateY\((?<y>\S+)\)$/);
            return new Matrix([1, 0, 0, 0, 1, parseFloat(parts.groups.y), 0, 0, 1]);
        }

        static fromRotate(def) {
            let parts = def.match(/^rotate\((?<angle>\S+)\)$/);
            let angle = parseFloat(parts.groups.angle) / 180 * Math.PI;
            return new Matrix([Math.cos(angle), -Math.sin(angle), 0, Math.sin(angle), Math.cos(angle), 0, 0, 0, 1]);
        }

        static fromScale(def) {
            let parts = def.match(/^scale\((?<x>\S+),\s*(?<y>\S+)\)$/);
            return new Matrix([parseFloat(parts.groups.x), 0, 0, 0, parseFloat(parts.groups.y), 0, 0, 0, 1]);
        }

        static fromScaleX(def) {
            let parts = def.match(/^scaleX\((?<angle>\S+)\)$/);
            return new Matrix([parseFloat(parts.groups.x), 0, 0, 0, 0, 0, 0, 0, 1]);
        }

        static fromScaleY(def) {
            let parts = def.match(/^scaleY\((?<angle>\S+)\)$/);
            return new Matrix([0, 0, 0, 0, parseFloat(parts.groups.y), 0, 0, 0, 1]);
        }

        static fromTransform(def) {
            def = def.trim();

            let result = Matrix.identity;
            while (def) {
                let step = def.match(/^(?<action>\S+)\([^\)]+\)/);

                for (let name of Object.getOwnPropertyNames(Matrix)) {
                    if (name.toLowerCase() == `from${step.groups.action}`.toLowerCase()) {
                        let next = Matrix[name](step[0]);

                        result = result.combine(next);
                        break;
                    }
                }

                def = def.substr(step[0].length).trim();
            }
            return result;
        }

        static identity = new Matrix([1,0,0,0,1,0,0,0,1]);

        combine(m) {
            let c1 = this.components;
            let c2 = m.components;
            return new Matrix([
                c1[0] * c2[0] + c1[1] * c2[3] + c1[2] * c2[6],
                c1[0] * c2[1] + c1[1] * c2[4] + c1[2] * c2[7],
                c1[0] * c2[2] + c1[1] * c2[5] + c1[2] * c2[8],

                c1[3] * c2[0] + c1[4] * c2[3] + c1[5] * c2[6],
                c1[3] * c2[1] + c1[4] * c2[4] + c1[5] * c2[7],
                c1[3] * c2[2] + c1[4] * c2[5] + c1[5] * c2[8],

                c1[6] * c2[0] + c1[7] * c2[3] + c1[8] * c2[6],
                c1[6] * c2[1] + c1[7] * c2[4] + c1[8] * c2[7],
                c1[6] * c2[2] + c1[7] * c2[5] + c1[8] * c2[8],
                ]);
        }

        apply(v) {
            let c = this.components;
            return new Vector(
                c[0] * v.x + c[1] * v.y + c[2],
                c[3] * v.x + c[4] * v.y + c[5]
                );
        }

        toString() {
            let c = this.components;
            return `[[${c[0]}, ${c[1]}, ${c[2]}], [${c[3]}, ${c[4]}, ${c[5]}], [${c[6]}, ${c[7]}, ${c[8]}]]`;
        }
    }
//


function xmlnsClone(node, ns) {
    if (node instanceof Text) {
        return node;
    }
    let newNode = document.createElementNS(ns, node.tagName);
    for (let child of Array.from(node.childNodes)) {
        newNode.appendChild(xmlnsClone(child, ns));
    }
    for (let attr of Array.from(node.attributes)) {
        node.attributes.removeNamedItem(attr.name);
        newNode.attributes.setNamedItem(attr);
    }
    return newNode;
}

let nodes = Array.from(document.querySelectorAll("foreignObject>*"));
for (let node of nodes) {
    node.parentNode.appendChild(xmlnsClone(node, "http://www.w3.org/1999/xhtml"));
    node.remove();
}


let sliders = document.querySelector("#sliders");
let root = document.querySelector(':root');
let tireSize = document.querySelector("#tire-size");

function getStyle(attr) {
    return getComputedStyle(root).getPropertyValue(attr);
}

sliders.addEventListener("input", e => {
    let attr = e.target.getAttribute("data-variable");
    let unit = e.target.getAttribute("data-unit");
    root.style.setProperty(attr, e.target.value);
    e.target.nextElementSibling.innerText = `${e.target.value}${unit}`;
    tireSize.childNodes[0].remove();
    let ratio = ((+getStyle('--tire-diameter') - +getStyle('--rim-size'))*12.7) / +getStyle('--tire-width');
    ratio = Math.round(ratio * 20) * 5;
    tireSize.appendChild(document.createTextNode(`${getStyle('--tire-width')}/${ratio}R${getStyle('--rim-size')}`));
    //tireSize.innerXML = `${root.style.getPropertyValue('--tire-width')}/${1}R${root.style.getPropertyValue('--rim-size')}`;
});
for (let i of sliders.querySelectorAll("input")) {
    let attr = i.getAttribute("data-variable");
    let unit = i.getAttribute("data-unit");
    i.value = getStyle(attr);
    i.nextElementSibling.innerText = `${i.value}${unit}`;
}
